import { useSelector, useDispatch } from "react-redux";
import { useCallback } from 'react';

import classes from "./Counter.module.css";

const Counter = () => {
  const counter = useSelector(state => state.counter);
  const dispatch = useDispatch();
  const increaseDispatch = useCallback(() => dispatch({type: 'INCREASE'}), [dispatch]);
  const decreaseDispatch = useCallback(() => dispatch({type: 'DECREASE'}), [dispatch]);

  const toggleCounterHandler = () => {};

  if(counter < 0) {
    return;
  }
  return (
    <main className={classes.counter}>
      <h1>Redux Counter</h1>
      <div className={classes.value}>{counter}</div>
    <div>
      <button onClick={increaseDispatch}>Increase</button>
      <button onClick={decreaseDispatch}>Decrease</button>      
    </div>
      <button onClick={toggleCounterHandler}>Toggle Counter</button>
    </main>
  );
};

export default Counter;
